import React, { useState, useEffect } from 'react';
import { CssBaseline, Container, Paper, Grid, Typography, Avatar, List, ListItem, ListItemIcon, ListItemText, withStyles } from '@mui/material';
import { LiveTv, PlaylistPlay, ViewQuilt, MoreHoriz, Settings, ExitToApp } from '@mui/icons-material';
import axios from 'axios';

const styles = (theme) => ({
  root: {
    background: '#151515',
    minHeight: '100vh',
    color: 'white',
    borderBottom: 'none', // Remove the header line
  },
  sidebar: {
    background: '#0D0D0F',
    padding: '16px',
    height: '100vh',
  },
  sidebarItem: {
    color: 'white',
  },
  avatar: {
    width: '64px',
    height: '64px',
  },
  icon: {
    color: 'white', // Set icon color to white
  },
});

const App = (props) => {
  const [userData, setUserData] = useState({ username: 'John Doe', avatar: '' });

  useEffect(() => {
    axios
      .get('https://jsonplaceholder.typicode.com/users/1')
      .then((response) => {
        setUserData({ ...response.data, showDetails: false });
      })
      .catch((error) => {
        console.error('Error fetching user data:', error);
      });
  }, []);

  const { classes } = props;

  return (
    <div className={classes.root}>
      <CssBaseline />
      <Container>
        <Grid container spacing={0}>
          <Grid item xs={1}>
            {/* Sidebar 1 - Logo */}
            <Paper className={classes.sidebar}>
              {/* Your logo */}
              <img src="logo.png" alt="Logo" style={{ width: '100px' }} />
            </Paper>
          </Grid>
          <Grid item xs={3}>
            {/* Sidebar 2 - User Info and Navigation */}
            <Paper className={classes.sidebar}>
              <Avatar src={userData.avatar} className={classes.avatar} />
              <Typography variant="h6" className={classes.sidebarItem}>
                {userData.username}
              </Typography>
              <List>
                <ListItem button>
                  <ListItemIcon>
                    <LiveTv className={classes.icon} />
                  </ListItemIcon>
                  <ListItemText primary="Live" className={classes.sidebarItem} />
                </ListItem>
                <ListItem button>
                  <ListItemIcon>
                    <PlaylistPlay className={classes.icon} />
                  </ListItemIcon>
                  <ListItemText primary="Sequence" className={classes.sidebarItem} />
                </ListItem>
                <ListItem button>
                  <ListItemIcon>
                    <ViewQuilt className={classes.icon} />
                  </ListItemIcon>
                  <ListItemText primary="Layout" className={classes.sidebarItem} />
                </ListItem>
                <ListItem button>
                  <ListItemIcon>
                    <MoreHoriz className={classes.icon} />
                  </ListItemIcon>
                  <ListItemText primary="More" className={classes.sidebarItem} />
                </ListItem>
                <ListItem button>
                  <ListItemIcon>
                    <Settings className={classes.icon} />
                  </ListItemIcon>
                  <ListItemText primary="Settings" className={classes.sidebarItem} />
                </ListItem>
                <ListItem button>
                  <ListItemIcon>
                    <ExitToApp className={classes.icon} />
                  </ListItemIcon>
                  <ListItemText primary="Logout" className={classes.sidebarItem} />
                </ListItem>
              </List>
            </Paper>
          </Grid>
          <Grid item xs={8}>
            {/* Main Content */}
            <Paper style={{ background: '#151515', padding: '16px' }}>
              {/* Your content goes here */}
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default withStyles(styles)(App);
